@st.dialog("Finding Detail",width="large")
def finding_showcase(title,severity, risk_details, remediation, uid, region):
    st.markdown(f"""### Title: {title[0]}""")
    st.markdown(f""" **Severity:** {"\n".join(severity)}""")
    st.markdown(f""" **Affected Items:** {len(uid)}""")
    st.dataframe(uid)
    st.markdown(f""" **Regions:** {" ,".join(region)}""")
    st.markdown(f""" **Risk Details:**""")
    st.text("\n".join(risk_details))
    st.markdown(f""" **Remediation:**""")
    st.text("\n".join(remediation))



st.title('Prowler Parser v0.1')
files = st.file_uploader("Choose a prowler JSON file", accept_multiple_files=True)
if files:
    df = pd.DataFrame()
    for file in files:
        df_temp = pd.read_json(file)
        df_temp['filename'] = file.name
        df_resources_temp = pd.json_normalize(df_temp['resources'])
        df_resources_list = []
        for _, row in df_resources_temp.iterrows():
            regions = []
            uids = []
            for _, col in row.items():
                for item in row:
                    if isinstance(item, dict):
                        regions.append(item.get('region', ''))
                        uids.append(item.get('uid', ''))
                df_resources_list.append({
                'region': ', '.join(regions),
                'uid': ', '.join(uids)
                })
        df_resources = pd.DataFrame(df_resources_list)
        # df_resources = pd.DataFrame()
        # for index1, mainrow in df_resources_temp.iterrows():
        #     inserter = dict()
        #     for index2, row in mainrow.items():
